# A simple generator of Motzkin-paths (see the first comment of _David Callan_).
C = str.count
def aGen(n: int):
    a = [""]
    for w in a:
        if len(w) == n:
            if C(w, "U") == C(w, "D"): yield w
        else:
            for j in "UDF":
                u = w + j
                if C(u, "U") >= C(u, "D"): a += [u]
    return a
for n in range(6):
    MP = [w for w in aGen(n)];
    print(len(MP), ":", MP)  # _Peter Luschny_, Dec 03 2024

